import { booksByGenre } from "./Api";

export function GetBookByID(bookID) {
  for (const genreBooks of Object.values(booksByGenre)) {
    for (const book of genreBooks) {
      if (book.id === bookID) {
        return book;
      }
    }
  }
  return null;
}
